  \"rxnorm\",\n\t\"isopen\": false,\n\t\"url\": null,\n\t\"notes\": \"<p>RxNorm provides
  normalized names for clinical drugs and links its names to many of the drug vocabularies
  commonly used in pharmacy management and drug interaction software, including those
  of First Databank, Micromedex, MediSpan, Gold Standard, and Multum. By providing
  links between these vocabularies, RxNorm can mediate messages between systems not
  using the same software and vocabulary.</p>n<p>RxNorm now includes the National
  Drug File - Reference Terminology (NDF-RT) from the Veterans Health Administration.
  NDF-RT is a terminology used to code clinical drug properties, including mechanism
  of action, physiologic effect, and therapeutic category.</p>n\",\n\t\"license_title\":
